import { createTheme } from "@material-ui/core";

const theme = createTheme({
  palette: {
    common: {
      yellow: "#D09A0A",
      green: "#309916",
      dark: "#000000",
      lightDark: "#111111",
      white: "#fff",
      gray: "#808080",
    },
  },
});
export default theme;
